selector_to_html = {"a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../_images/primary-address-zoomed-in.png\"><img alt=\"../../_images/primary-address-zoomed-in.png\" src=\"../../_images/primary-address-zoomed-in.png\" style=\"width: 400px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Primary Address</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id4\"]": "<figure class=\"align-center\" id=\"id4\">\n<a class=\"reference internal image-reference\" href=\"../../_images/upload-logo.png\"><img alt=\"../../_images/upload-logo.png\" src=\"../../_images/upload-logo.png\" style=\"width: 400px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Upload Logo</span><a class=\"headerlink\" href=\"#id4\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#primary-address\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Primary Address<a class=\"headerlink\" href=\"#primary-address\" title=\"Link to this heading\">#</a></h2><p>You can edit any of the information in this section by simply clicking into the field.</p><p>The following fields are required and cannot be left blank:</p>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../_images/info-zoomed-in.png\"><img alt=\"../../_images/info-zoomed-in.png\" src=\"../../_images/info-zoomed-in.png\" style=\"width: 400px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Name and Contact Information</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#editing-company-information\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Editing Company Information<a class=\"headerlink\" href=\"#editing-company-information\" title=\"Link to this heading\">#</a></h1><p>The <strong>Profile</strong> screen allows you edit the following information about your company:</p>", "a[href=\"#mailing-address\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mailing Address<a class=\"headerlink\" href=\"#mailing-address\" title=\"Link to this heading\">#</a></h2><p>Similar to the Primary address, you can edit the following information:</p>", "a[href=\"#uploading-logo\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Uploading Logo<a class=\"headerlink\" href=\"#uploading-logo\" title=\"Link to this heading\">#</a></h2><p>You can upload a logo for your company by clicking the <a class=\"reference internal\" href=\"#tippy=test-key\"><span class=\"xref myst\">Upload Logo</span></a> button.</p><p><a class=\"reference internal\" href=\"#tippy=upload-logo-button\"><span class=\"xref myst\">Hover text</span></a></p>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mailing-address-zoomed-in.png\"><img alt=\"../../_images/mailing-address-zoomed-in.png\" src=\"../../_images/mailing-address-zoomed-in.png\" style=\"width: 400px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Mailing Address</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#editing-name-and-contact-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Editing Name and Contact Information<a class=\"headerlink\" href=\"#editing-name-and-contact-information\" title=\"Link to this heading\">#</a></h2><p>The <strong>Info</strong> section of the <strong>Profile</strong> screen allows you to edit the following information about your company:</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false, theme: 'material', duration: [200, 100], delay: [200, 500],

            });
        };
    };
    console.log("tippy tips loaded!");
};
